public Num fleetNumber(DNRVisibleFleetNumber _tpbFleetNumber = WPPParameters::find().TPBFleetNumber)
{
    switch(_tpbFleetNumber)
    {
        case DNRVisibleFleetNumber::AssetId:        return this.AssetId;
        case DNRVisibleFleetNumber::InventSerialId: return this.InventSerialId;
        case DNRVisibleFleetNumber::ObjectId:       return this.ObjectId;
        case DNRVisibleFleetNumber::FleetNumber:    return this.BOBFleetNumber;
        default:                                    return '<none>';
    }
}

public boolean isInternalTask()
{
    return (this.TaskType == WPPTaskType::InternalDelivery ||
            this.TaskType == WPPTaskType::InternalLoad);
}

public WPPWorkOrderLine workOrderLine(boolean _forUpdate = false)
{
    WPPWorkOrderLine ret;
    ;

    if(this.WorkOrderLineRecId)
    {
        if(_forUpdate)
        {
            ret.selectForUpdate(true);
        }

        select firstOnly ret
        where ret.RecId == this.WorkOrderLineRecId;
    }

    return ret;
}

