WPPWorkOrderTable workOrderTable()
{
    WPPWorkOrderTable workOrderTable;
    ;

    if(this.WorkOrderTableRecId)
    {
        select firstOnly workOrderTable
        where workOrderTable.RecId == this.WorkOrderTableRecId;
    }

    return workOrderTable;
}

public static List getAffectedFields(WPPTmpTransportPlanboardData _tmpData)
{
    List    list;

    list = new List(Types::Integer);

    if (_tmpData.WorkOrderLineStatus < WPPWorkOrderLineStatus::Released
    &&  (_tmpData.TaskType == WPPTaskType::Delivery || _tmpData.TaskType == WPPTaskType::Load))
    {
        if (_tmpData.HasObjectNote)
        {
            // Requested rental type is red
            list.addEnd(fieldId2Ext(fieldNum(WPPTmpTransportPlanboardData, RentalTypeIdRequested), 1));
        }

        if (_tmpData.HasLocationNote
        ||  _tmpData.HasRouteNote)
        {
            // City text is red
            list.addEnd(fieldId2Ext(fieldNum(WPPTmpTransportPlanboardData, City), 1));
        }
    }

    if (_tmpData.HasOrderNote
    ||  _tmpData.HasInternalNote
    ||  _tmpData.HasTerminationNote)
    {
        // Customer name text is red
        list.addEnd(fieldId2Ext(fieldNum(WPPTmpTransportPlanboardData, CustName), 1));
    }

    if ((_tmpData.TaskType == WPPTaskType::Delivery || _tmpData.TaskType == WPPTaskType::InternalDelivery)
    &&  _tmpData.RequestedStartDateTime < DateTimeUtil::getSystemDateTime())
    {
        // Task date text is red
        list.addEnd(fieldId2Ext(fieldNum(WPPTmpTransportPlanboardData, RequestedStartDateTime), 1));
    }

    if ((_tmpData.TaskType == WPPTaskType::Load || _tmpData.TaskType == WPPTaskType::InternalLoad)
    &&  _tmpData.RequestedStartDateTime > DateTimeUtil::getSystemDateTime())
    {
        // Task date text is red
        list.addEnd(fieldId2Ext(fieldNum(WPPTmpTransportPlanboardData, RequestedStartDateTime), 1));
    }

    return list;
}

public static NumberOfRecords getNumberOfRecords(WPPTmpTransportPlanboardData _tmpData)
{
    WPPTmpTransportPlanboardData    tmpData;

    tmpData.linkPhysicalTableInstance(_tmpData);

    select count(RecId) from tmpData;

    return tmpData.RecId;
}

public static client server FieldId sortSetup2FieldId(WPPSortSetup _sortSetup)
{
    FieldId fieldId;

    switch (_sortSetup)
    {
        case WPPSortSetup::RequestedStartDateTime:
            fieldId = fieldNum(WPPTmpTransportPlanboardData, RequestedStartDateTime);
            break;

        case WPPSortSetup::ZipCode:
            fieldId = fieldNum(WPPTmpTransportPlanboardData, ZipCode);
            break;

        case WPPSortSetup::Customer:
            fieldId = fieldNum(WPPTmpTransportPlanboardData, CustAccount);
            break;

        case WPPSortSetup::City:
            fieldId = fieldNum(WPPTmpTransportPlanboardData, City);
            break;
    }

    return fieldId;
}
